import React from 'react'
import { useState, useEffect } from 'react';

export default function GetData() {
    const [post, setPost] = useState([]);
    const getUser = async ()=>{
        const res = await fetch('api.github.com/users');
        setPost(await res.json());
    }   
    useEffect(()=>{
        
        getUser();
    }, []);
    return (
        <div>
            <ul>
                {
                    post.map((ele)=>{
                        return (
                            <li key ={ele.id}>
                                {ele.login}
                            </li>
                        )
                    })
                }   
            </ul>
        </div>
    )
}
